// src/components/Home.js
import React from 'react';
import Navbar from './Navbar';  // Assicurati di avere la tua navbar
import Footer from './Footer';  // Assicurati di avere il tuo footer
import Hero from '../components/Hero';
import AboutUs from '../components/AboutUs';
import Testimonials from '../components/Testimonials';

function Home() {
  return (
    <div>
      <Hero />
      <AboutUs />
      <Testimonials />
    </div>
  );
}

export default Home;
